--+ holdcas on;
create table t (i int not null, j int, k int, l int, s string);



create index idx on t(i asc,j desc,k desc,l asc);
update statistics on all classes;

-- order by skipping: skip
select /*+ recompile INDEX_SS */   i,j,k,l from t where j=2 and s <> 'x' order by i asc, j desc, k desc limit 10;

-- no skip
select /*+ recompile INDEX_SS */   i,j,k,l from t where j=2 and s <> 'x' order by i asc, j desc, l desc limit 10;

-- skip, descending index
select /*+ recompile INDEX_SS */   i,j,k,l from t where j=2 and s <> 'x' order by i desc limit 10;

-- skip, descending index
select /*+ recompile INDEX_SS */   i,j,k,l from t where j=2 and s <> 'x' order by i desc, k asc limit 10;

-- skip
select /*+ recompile INDEX_SS */   i,j,k,l from t where j>2 and i <> 0 and s <> 'x' order by i asc, j desc, k desc, l asc limit 10;

-- skip, because it ignores the sort parameter j (it is pinned to "2" by the condition)
select /*+ recompile INDEX_SS */   i,j,k,l from t where j=2 and i <> 0 and s <> 'x' order by i asc, j asc, k desc, l asc limit 10;

-- no skip ordby, j is no longer in an equality condition
select /*+ recompile INDEX_SS */   i,j,k,l from t where j>2 and i <> 0 and s <> 'x' order by i asc, j asc limit 10;

-- skip order by, because directions coincide 
select /*+ recompile INDEX_SS */   i,j,k,l from t where j>2 and i <> 0 and s <> 'x' order by i asc, j desc limit 10;


-- no skip
select /*+ recompile INDEX_SS */   i,j,k,l from t where j>2 and i <> 0 and s <> 'x' order by i asc, j desc, k desc, l desc limit 10;

-- no skip
select /*+ recompile INDEX_SS */   i,j,k,l from t where j>2 and i <> 0 and s <> 'x' order by i asc, j asc, k asc, l desc limit 10;

-- "ghost columns" introduced by "order by":
-- iss, skip ordby
select /*+ recompile INDEX_SS */   k from t where j>2 and s <> 'x' order by i asc limit 10;
-- no iss, just covering
select /*+ recompile */   k from t where k>2 and s <> 'x' order by i asc, j desc limit 10;
-- no iss
select /*+ recompile */   k from t where k=2 and s <> 'x' order by j desc limit 10;


drop table t;
commit;
--+ holdcas off;
